import React, { Component } from "react";
import "./style.css";

class Saida extends Component {
  renderItemList = (item) => {
    return (
      <li className="saida-item">
              <div>
                <input className="saida-checkbox" type="checkbox" onClick={this.props.HandleChecked}/>
                <span className="saida-texto"></span>
              </div>
              <div>
                <button className="saida-deletar" type="button" onClick={this.props.HandleDelete}>
                  deletar
                </button>
              </div>
            </li>
    )
  }

  render() {
    return (
      <section className="saida-container">
        <div className="saida-wrap">
          <ul className="saida-lista">
            <li className="saida-item">
              <div>
                <input className="saida-checkbox" type="checkbox" onClick={this.props.HandleChecked}/>
                <span className="saida-texto"></span>
              </div>
              <div>
                <button className="saida-deletar" type="button" onClick={this.props.HandleDelete}>
                  deletar
                </button>
              </div>
            </li>
          </ul>
        </div>
      </section>
    );
  }
}

export default Saida;
